enableSharing=function(){if(!navigator.share)return void console.log("navigator.share not found");document.querySelectorAll(".share").forEach(function(t){console.log("Adding onclick"),t.addEventListener("click",function(){t.style.display="block;",navigator.share({url:window.location.href,title:"Sharing - "+t.getAttribute("article"),text:"I found this article at DWF's Journal and thought you might like it."})})})},enableSharing();